const securityTransitions = [
    {
        from: [
            _support_constants__WEBPACK_IMPORTED_MODULE_0__.SECURITY_LEVELS.LOW,
            _support_constants__WEBPACK_IMPORTED_MODULE_0__.SECURITY_LEVELS.LOW,
            _support_constants__WEBPACK_IMPORTED_MODULE_0__.SECURITY_LEVELS.LOW,
        ],
        to: [
            _support_constants__WEBPACK_IMPORTED_MODULE_0__.SECURITY_LEVELS.HIGH,
            _support_constants__WEBPACK_IMPORTED_MODULE_0__.SECURITY_LEVELS.HIGH,
            _support_constants__WEBPACK_IMPORTED_MODULE_0__.SECURITY_LEVELS.HIGH,
        ],
        name: "low-to-high",
    },
];
// Test each transition with better error handling
securityTransitions.forEach((transition, index) => {
    const logArgs = [
        `Testing transition ${transition.name} (${index + 1}/${securityTransitions.length})`,
    ];
    cy.log(logArgs[0]);
    // Set initial levels with type assertion
    cy.setSecurityLevels(transition.from[0], transition.from[1], transition.from[2]);
    cy.wait(500); // Reduced wait time
    // Take screenshot only once
    cy.screenshot(`transition-initial-${transition.name}`);
    // Look for important widgets to verify initial state
    findImportantWidgets().then((widgets) => {
        // Capture initial content of each widget for comparison
        captureWidgetStates(widgets).then((initialStates) => {
            // Perform transition with type assertion
            const changeLogArgs = [
                `Changing to security levels: ${transition.to.join(", ")}`,
            ];
            cy.log(changeLogArgs[0]);
            cy.setSecurityLevels(transition.to[0], transition.to[1], transition.to[2]);
            cy.wait(500); // Reduced wait time
            // Take screenshot after transition
            cy.screenshot(`transition-after-${transition.name}`);
            // Check widgets after transition
            findImportantWidgets().then((newWidgets) => {
                const foundLogArgs = [
                    `Found ${newWidgets.length} widgets after transition`,
                ];
                cy.log(...foundLogArgs);
                // Verify number of widgets didn't decrease significantly
                expect(newWidgets.length).to.be.at.least(Math.max(1, widgets.length - 1), "Number of widgets shouldn't decrease significantly during transitions");
                // Process each widget after transition - reduced screenshot overhead
                cy.wrap(newWidgets).each(($widget, i) => {
                    const id = $widget.attr("data-testid") || `widget-${i}`;
                    // Check for problematic content
                    checkForProblematicContent($widget);
                    // Compare with initial state if available
                    if (initialStates[id]) {
                        compareWidgetContent($widget, initialStates[id], id);
                    }
                });
            });
        });
    });
});
